export default function Contact() {
  return (
    <contact className="homepage-footer">
      <h2>Contact</h2>
      <br />
      <span>Email: </span>kshawn001@gmail.com
      <br />
      <a href="">GitHub</a>
      <br />
      <a href="">LinkedIn</a>
      <br />
      <a href="">Resume</a>
    </contact>
  );
}
